import './App.css';

function Header(){
  return (
    <header>
      <h1>Eve's kitchen</h1>
    </header>
  );
}

function Main(){
  return (
    <section>
      <p> We serve the best food around. </p>
    </section>
  )
}

function Footer(){
  return (
    <footer>
      <p> (It's true) </p>
    </footer>
  )
}

function App() {
  return (
    <div className="App">
      < Header />
      < Main/>
      <Footer/>
    </div>
  );
}

export default App;
